import React from 'react';

const OrderSection = () => {
    return (
        <div id="order">
            <h2>Place Your Order</h2>
            <p>For orders, call this number: <strong>123-456-7890</strong></p>
            <p>Orders should be placed with Thursday's notice as we only cater to weekends.</p>
            <p>Pickup Location: Aurora, Illinois</p>
        </div>
    );
}

export default OrderSection;
